export class User {
    constructor(id, firstName, middleName, lastName, email, phone_no, role, address) {
        this.id = id;
        this.firstName = firstName;
        this.middleName = middleName;
        this.lastName = lastName;
        this.email = email;
        this.phone_no = phone_no;
        this.role = role;
        this.address = address;
    }
}
